import React from "react"
import Calc from "../calctor"
import Userlist from "../userlist"
export default class List extends React.Component{
    constructor(props){
        super(props)
        this.state={display1:"none",display2:"none",blue:"blue"}
        this.index=this.index.bind(this) 
        this.user=this.user.bind(this)
    }
    render(){
        let jsx1=this.state.display1==="block"?<Calc/>:""
        let jsx2=this.state.display2==="block"?<Userlist/>:""    
        return(  
            <div>
                <div className="lists">
                    <div></div>
                    {/* // eslint-disable-next-line */}
                    <div onClick={this.index} className={this.state.display1==="block"?this.state.blue:"index1"}>首页</div>
                    <div></div>
                    {/* // eslint-disable-next-line */}
                    <div onClick={this.user} className={this.state.display2==="block"?this.state.blue:"sale1"}>收入分析</div>
                    <div></div>
                </div>
                    {/* 是否显示计算器组件 */}
                    {jsx1}
                    {/* 是否显示用户列表组件 */}
                    {jsx2}
            </div>
        )        
    }
    //  tab 按钮切换
    index(){
        this.setState({display1:"block",display2:"none"})
    }
    user(){
        this.setState({display1:"none",display2:"block"})
    }
}
